import React, {useState,useEffect} from 'react'
import {Link,useParams } from 'react-router-dom'
import '../css/menureg.css';

const CodeReg = () => {
    const params = new URLSearchParams(window.location.search);
    let code = params.get("code");

    const[codeReg,setCodeReg] = useState({});
    const[mstCodeReg,setMstCodeReg] = useState({});

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:9191/api/getMstCode');
                const data = await response.json();
                setMstCodeReg({
                    ...mstCodeReg,
                    mstCd: data.mstCd,
                    mstNm: data.mstNm,
                    desc: data.desc
                });
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        };
      
        fetchData();

        if(code) {
            const fetchData = async () => {
                try {
                    const response = await fetch('http://localhost:9191/api/getMstCode');
                    const data = await response.json();
                    setMstCodeReg({
                        ...mstCodeReg,
                        mstCd: data.mstCd,
                        mstNm: data.mstNm,
                        desc: data.desc
                    });
                } catch (error) {
                    console.error("Error fetching data:", error);
                }
            };
        }
    }, []);
     
    
        const changeValue=(e)=>{
            setCodeReg({
                ...codeReg,
                [e.target.name]:e.target.value
            })
        }       
       
        const handleSubmit = (e) => {
            e.preventDefault();
            let apiPath="";
            if(code){
                apiPath = "http://localhost:9191/api/updateCode";
            }else{
                apiPath = "http://localhost:9191/api/menuform";
            }
           
            fetch(apiPath,{
                method:"POST",
                headers:{
                    "Content-Type":"application/json; charset=utf-8"
                },
                //body: JSON.stringify(menureg)
            })
            .then((response)=>{
                if(response.status==200){
                    window.location.href = "./MenuIndex";
                    if(code){
                        alert("수정되었습니다.");
                    }else{
                        alert("등록되었습니다.");
                    }
                }
            });
        };

         
        

    return (
        <div>
            <div id="content_center" style={{ textAlign: 'center', width: '1800px' }}>
                <h1 class="title" >공통 코드 등록(수정)</h1>
            </div>
            <form onSubmit={handleSubmit}>
                <div class="form-container">
                    <div class="menu-form-group">
                        <label for="menu-name">코드</label>
                        <input type="text" id="menu-name" name="mstCd" value={codeReg.mstCd} onChange={(e) => changeValue(e)} placeholder="코드를 입력하세요" />
                    </div>
                    
                    <div class="menu-form-group">
                        <label for="menu-name">코드</label>
                        <input type="text" id="menu-name" name="mstCd" value={codeReg.mstCd} onChange={(e) => changeValue(e)} placeholder="코드를 입력하세요" />
                    </div>
                    <div class="menu-form-group">
                        <label for="mstNm">코드명</label>
                        <input type="text" id="name" name="mstNm" value={codeReg.mstNm} onChange={(e) => changeValue(e)} placeholder="코드명을 입력하세요" />
                    </div>
                    <div class="menu-form-group">
                        <label for="link">내용</label>
                        <textarea placeholder="내용을 입력하세요." name="desc" rows="4" onChange={(e) => changeValue(e)} value={codeReg.desc}></textarea>
                    </div>
                    <div class="menu-button-group">
                        <button type="button"><Link to="/menu/MenuIndex">목록</Link></button>
                        <button type="submit">등록(수정)</button>
                    </div>
                </div>
            </form>
        </div>
    );
};

export default CodeReg;
